import React from 'react';
import ArbabGroup from '../arbabGroup';
import ZkFoils from '../zkFoils';
import ZkPlastics from '../zkPlastics';
import ZkHealthCare from '../zkHealthCare';
import ZkInk from '../zkInk';
import AantCosmetics from '../aantCosmetics';
import Footer from '../Footer'

function SisterConcerns() {
  return (
    <>
      <ArbabGroup />
      <ZkFoils />
      <ZkPlastics />
      <ZkHealthCare />
      <ZkInk />
      <AantCosmetics />
      <Footer />
    </>
  );
}

export default SisterConcerns;
